import React from 'react';
import './css/footer.css';
const Footer = ()=>{
return(
    <>
        <div className='footermain'>
            <p>Designed and Developed by Rushikesh Chape</p>
            <p>Copyright <Copyright/> 2024</p>
            
        </div>
    </>
)
}

export default Footer;
